// components/ImageAudioSection.js
import React from 'react';

const ImageAudioSection = () => (
  <div className="p-4 grid grid-rows-2 gap-6">
    <div className="grid grid-cols-2 gap-4">
      <div className="border border-black h-48 flex items-center justify-center text-sm">최근에 찍힌 사진</div>
      <div className="border border-black h-48 flex items-center justify-center text-sm">AI가 분석한 사진</div>
    </div>
    <div className="grid grid-cols-2 gap-4">
      <div className="border border-black h-24 flex items-center justify-center text-sm">최근에 녹음된 음성</div>
      <div className="border border-black h-24 flex items-center justify-center text-sm">AI가 분석한 음성</div>
    </div>
  </div>
);

export default ImageAudioSection;
